import React, { useState } from "react";
import PropTypes from "prop-types";
import "../../styles/RequestItem.css";

const RequestItem = ({ request }) => {
  const { cliente, musicas, data_requisicao } = request;
  const [comentario, setComentario] = useState("");
  const [selectedMusica, setSelectedMusica] = useState(null);

  // Função para enviar o status e o comentário ao servidor
  const sendStatus = async (musicaId, statusId, comentarioTexto) => {
    try {
      const response = await fetch("http://localhost:3000/process-action", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          requisicao_id: musicaId,
          status_id: statusId,
          comentario: comentarioTexto,
        }),
      });

      const result = await response.json();
      alert(result.message); // Notifica o usuário
      setComentario(""); // Limpa o comentário após envio
    } catch (error) {
      console.error("Erro ao enviar o status:", error);
    }
  };

  // Lida com o clique nos botões (abre o prompt de comentário)
  const handleAction = async (musica, statusId) => {
    const comentarioTexto = prompt(
      `Digite um comentário para esta ação (${statusId === 1 ? "Aprovar" : "Negar"}):`
    );
    if (comentarioTexto) {
      setSelectedMusica(musica);
      await sendStatus(musica.id, statusId, comentarioTexto);
    }
  };

  return (
    <div className="request-item">
      {/* Cabeçalho da requisição */}
      <div className="request-header">
        <div className="request-avatar">
          <div className="avatar-placeholder">
            {cliente.nome.charAt(0).toUpperCase()}
          </div>
        </div>
        <div className="user-info">
          <p>
            <strong>{cliente.nome}</strong>
          </p>
        </div>
      </div>

      {/* Lista de músicas requisitadas */}
      <div className="music-list">
        <h4>Músicas Requisitadas:</h4>
        {musicas.length > 0 ? (
          musicas.map((musica, index) => (
            <div key={index} className="music-item">
              <img
                src={musica.imagem || "https://via.placeholder.com/50"}
                alt={musica.nome}
                className="music-thumbnail"
              />
              <div className="music-details">
                <p>
                  <strong>Nome:</strong> {musica.nome}
                </p>
                <p>
                  <strong>Duração:</strong>{" "}
                  {Math.floor(musica.duracao / 60000)}m{" "}
                  {((musica.duracao % 60000) / 1000).toFixed(0)}s
                </p>
              </div>
              <div className="music-actions">
                <button
                  className="approve"
                  onClick={() => handleAction(musica, 1)}
                >
                  ✓
                </button>
                <button className="deny" onClick={() => handleAction(musica, 2)}>
                  ✗
                </button>
              </div>
            </div>
          ))
        ) : (
          <p>Sem músicas nesta requisição.</p>
        )}
      </div>

      {/* Rodapé da requisição */}
      <div className="request-footer">
        <p>
          <strong>Data da Requisição:</strong>{" "}
          {new Date(data_requisicao).toLocaleString()}
        </p>
      </div>
    </div>
  );
};

// Validação das propriedades recebidas pelo componente
RequestItem.propTypes = {
  request: PropTypes.shape({
    cliente: PropTypes.shape({
      id: PropTypes.number.isRequired,
      nome: PropTypes.string.isRequired,
    }).isRequired,
    musicas: PropTypes.arrayOf(
      PropTypes.shape({
        id: PropTypes.number.isRequired, // Adiciona o ID da música
        nome: PropTypes.string.isRequired,
        imagem: PropTypes.string,
        duracao: PropTypes.number.isRequired,
      })
    ).isRequired,
    data_requisicao: PropTypes.string.isRequired,
  }).isRequired,
};

export default RequestItem;
